import React from "react";
import "./NewExpense.css";
import ExpenseForm from "./ExpenseForm";
const NewExpense = () => {
  const expenseDataHandler = (expenseFormData) => {
    const expensedata = {
      ...expenseFormData,
      id: Math.random(),
    };
  };
  return (
    <div className="new-expense">
      <ExpenseForm />
    </div>
  );
};

export default NewExpense;
